import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let currDate = new Date();
let currTime = currDate.getHours();
let greetColor;
if(1 <= currTime <= 11 ){
  greetColor = '#06b81d';
}
else if(12 <= currTime <= 19){
  greetColor = '#f78d14';
}
else if(20 <= currTime <= 24){
  greetColor = '#575553';
}


ReactDOM.render(
  <>
  <div className = 'greet_div'>
      <h1>Hello Sir, <span className='greetings' style={{color:greetColor}}>Good Morning</span></h1>
  </div>

  </>,
  document.getElementById('root')
);
